import React from "react";
import classes from "./ButtonIcon.module.css";
import { AddCircleOutlineIcon, EditIcon } from "@material-ui/icons";

const buttonIcon = (props) => {
  return (
    <props.btnType
      className={[classes.ButtonIcon, classes[props.btnStyle]].join(" ")}
      onClick={props.clicked}
    />
  );
};

export default buttonIcon;
